import React from 'react';

const GameOver = ({ winner, onRestart }) => {
    return (
    <div className="game-over">
        <h2>Game Over! Winner: {winner}</h2>
        <button onClick={onRestart}>Start New Game</button>
    </div>
    );
};

export default GameOver;
